import React, { useEffect, useState } from 'react';
import { ThemeProvider, CssBaseline, AppBar, Toolbar, Button, Typography, Dialog, DialogTitle, DialogContent, DialogActions, TextField } from '@mui/material';
import { BrowserRouter, Routes, Route, Link, useNavigate } from 'react-router-dom';
import { useSelector, useDispatch } from 'react-redux';
import { loginSuccess, logout } from './features/auth/authSlice';
import { setClientName } from './features/questions/responsesSlice';
import { useAuth } from '@workos-inc/authkit-react';
import theme from './theme';
import Home from './pages/Home';
import About from './pages/About';
import Questions from './pages/Questions';
import ServiceCatalog from './pages/ServiceCatalog';
import Pricing from './pages/Pricing';
import Login from './features/auth/Login';
import ProtectedRoute from './features/auth/ProtectedRoute';

function AppContent() {
  const storedUser = useSelector((state) => state.auth.user);
  const dispatch = useDispatch();
  const navigate = useNavigate();
  const { user, isLoading, signOut } = useAuth();
  const [openModal, setOpenModal] = useState(false);
  const [clientNameInput, setClientNameInput] = useState('');

  useEffect(() => {
    if (isLoading) return;

    if (user && storedUser?.id !== user.id) {
      dispatch(loginSuccess(user));
    }

    if (!user && storedUser) {
      dispatch(logout());
    }
  }, [dispatch, isLoading, storedUser, user]);

  const activeUser = user ?? storedUser;

  const handleNewPriceClick = () => {
    setOpenModal(true);
  };

  const handleModalClose = () => {
    setOpenModal(false);
    setClientNameInput('');
  };

  const handleClientNameSubmit = () => {
    if (clientNameInput.trim()) {
      dispatch(setClientName(clientNameInput));
      setOpenModal(false);
      setClientNameInput('');
      navigate('/questions');
    }
  };

  const handleKeyPress = (e) => {
    if (e.key === 'Enter') {
      handleClientNameSubmit();
    }
  };

  return (
    <ThemeProvider theme={theme}>
      <CssBaseline />
      <BrowserRouter>
        <AppBar position="static">
          <Toolbar>
            <Button color="inherit" component={Link} to="/">Home</Button>
            <Button color="inherit" component={Link} to="/about">About</Button>
            <Button color="inherit" component={Link} to="/questions">Questions</Button>
            <Button color="inherit" component={Link} to="/services">Services</Button>
            <Button color="inherit" component={Link} to="/pricing">Pricing</Button>
            <Button 
              variant="contained" 
              size="small" 
              sx={{ ml: 2, backgroundColor: '#1976d2', '&:hover': { backgroundColor: '#1565c0' } }}
              onClick={handleNewPriceClick}
            >
              New Price
            </Button>
            {!activeUser && <Button color="inherit" component={Link} to="/login">Login</Button>}
            {activeUser && (
              <>
                <Typography sx={{ flexGrow: 1, ml: 2 }}>{activeUser.email}</Typography>
                <Button color="inherit" onClick={() => signOut({ returnTo: window.location.origin })}>
                  Logout
                </Button>
              </>
            )}
          </Toolbar>
        </AppBar>
        <Routes>
          <Route path="/" element={<ProtectedRoute><Home /></ProtectedRoute>} />
          <Route path="/about" element={<About />} />
          <Route path="/questions" element={<Questions />} />
          <Route path="/services" element={<ServiceCatalog />} />
          <Route path="/pricing" element={<Pricing />} />
          <Route path="/login" element={<Login />} />
        </Routes>
        <Dialog open={openModal} onClose={handleModalClose} maxWidth="sm" fullWidth>
          <DialogTitle>Create New Price Quote</DialogTitle>
          <DialogContent>
            <TextField
              autoFocus
              margin="dense"
              label="Client Name"
              type="text"
              fullWidth
              variant="outlined"
              value={clientNameInput}
              onChange={(e) => setClientNameInput(e.target.value)}
              onKeyPress={handleKeyPress}
              sx={{ mt: 2 }}
              placeholder="Enter client name"
            />
          </DialogContent>
          <DialogActions>
            <Button onClick={handleModalClose}>Cancel</Button>
            <Button 
              onClick={handleClientNameSubmit} 
              variant="contained" 
              color="primary"
              disabled={!clientNameInput.trim()}
            >
              Continue
            </Button>
          </DialogActions>
        </Dialog>
      </BrowserRouter>
    </ThemeProvider>
  );
}

export default App;
